import { FaSearch } from "react-icons/fa";
import classes from "./NavBar.module.css"

const Navbar = () => {
  return (
    <div className={classes.header}>
      <div>
        <FaSearch
          style={{ color: "#666", fontSize: "18px", opacity: "0.9" }}
        />
      </div>
      <div></div>
      <div></div>
    </div>
  );
};
export default Navbar;
